// Import thư viện mới
import React from 'react';
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

// Tạo component Duyetchungtu
function Duyetchungtu({ employees }) {
  return (
    <TableContainer component={Paper} sx={{ maxHeight: 'calc(100vh - 200px)', marginTop: '24px' }}>
      <Table sx={{ minWidth: 650, overflow: 'auto' }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell align="left">Tên</TableCell>
            <TableCell align="left">Họ</TableCell>
            <TableCell align="left">Email</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {employees.map((row) => (
            <TableRow
              key={row.employeeName}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell align="left">{row.firstName}</TableCell>
              <TableCell align="left">{row.lastName}</TableCell>
              <TableCell align="left">{row.email}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default Duyetchungtu;
